import {Link} from "react-router-dom";
import {useParams} from "react-router";
const UserDetail = () => {
    const {idUser} = useParams();
    console.log(idUser);
  return (
    <>
        <Link to={`/users`}>
        <div>Regresar</div>
        </Link>        
        <div>UserDetail</div>
    </>
  )
}

export default UserDetail
